import { List } from 'antd';

function SystemList() {
  const data = [
    'Công tyCP DVDL Phú Thọ',
    'Khu du lịch sinh thái Vàm Sát',
    'Khách sạn Ngọc Lan',
    'Khách sạn Phú Thọ',
    'Trung tâm Du Lịch Đầm Sen'
  ];
  return (<>
    <List
      dataSource={data}
    >

    </List>
  </>);
}
export default SystemList;
